function TopRated({ handleOrderPopup }) {
    const [visibleCount, setVisibleCount] = useState(12); // Initial visible cards

    useEffect(() => {
        AOS.init(); // Initialize AOS animations
    }, []);

    const handleShowMore = () => {
        setVisibleCount((prevCount) => prevCount + 12); // Increment visible cards by 9
    };

    return (
        <div className="bg-white dark:bg-gray-900 dark:text-white duration-200">
            <Navbar />
            <div className="container mx-auto">
                <div className="text-center mb-10 mt-16">
                    <h1 data-aos="fade-up" className="text-3xl font-bold">Best Products</h1>
                    <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-10 mt-16 place-items-center">
                        {ProductsData.slice(0, visibleCount).map((data) => (
                            <div
                                key={data.id}
                                data-aos="zoom-in"
                                className="rounded-2xl text-center mt-20 bg-white dark:bg-gray-800 hover:bg-black/80 dark:hover:bg-primary hover:text-white relative shadow-xl duration-300 group max-h-[500px] max-w-[350px]"
                            >
                                <img
                                    src={data.img}
                                    alt={data.title}
                                    className="max-w-[230px] block mx-auto transform -translate-y-20 group-hover:scale-110 duration-300 drop-shadow-md"
                                />
                                <div className="flex items-center justify-center gap-1">
                                    <FaStar className="text-yellow-500" />
                                    <FaStar className="text-yellow-500" />
                                    <FaStar className="text-yellow-500" />
                                    <FaStar className="text-yellow-500" />
                                </div>
                                <h1 className="text-xl font-bold">{data.title}</h1>
                                <p className="text-gray-500 group-hover:text-white duration-300 text-sm line-clamp-2">
                                    {data.description}
                                </p>
                                <button
                                    className="bg-primary hover:scale-105 duration-300 text-white py-1 px-4 rounded-full mb-5 mt-4 group-hover:bg-white group-hover:text-primary"
                                    onClick={handleOrderPopup}
                                >
                                    Order Now
                                </button>
                            </div>
                        ))}
                    </div>
                    {visibleCount < ProductsData.length && (
                        <div className="flex justify-center">
                            <button
                                onClick={handleShowMore}
                                data-aos="fade-up"
                                className="text-center mt-10 cursor-pointer bg-primary text-white py-2 px-6 rounded-md"
                            >
                                Show More
                            </button>
                        </div>
                    )}
                </div>
            </div>
            <Banner/>
            <Footer/>
        </div>
    );
}

export default TopRated;
